import { Pressable, StyleSheet, Text, View } from 'react-native'
import React from 'react'
import Header from '../components/Header/Header'

const Cart = () => {
  return (
    <View style={s.container}>
      <Header title={'Cart'}/>
      <Pressable/>
    </View>
  )
}

export default Cart

const s = StyleSheet.create({
    container: {
        backgroundColor: 'red',
        flex: 1,
    }
})
